div.synqy-lb-wrapper.synqy-lb-shade-dark {
  background-color: rgba(127,127,127,0.6)
}

div.synqy-lb-wrapper.synqy-device-desktop div.synqy-lb-outer div.synqy-lb-canvas
 {
  background-color: #ffffff;
  background-image: url(//d3uuhfww7vfibx.cloudfront.net/style/shoprite/bar-red.png);
  background-repeat: repeat-x;
  background-position: 0 -16px;
}

div.synqy-lb-wrapper div.synqy-lb-outer div.synqy-lb-canvas div.synqy-lb-canvas-inner {
    margin: 0px 20px 20px 20px;
}

div.synqy-lb-wrapper div.synqy-lb-outer div.synqy-lb-canvas .synqy-lb-toptoolbar {
  height: 60px;
  background: none;
}

div.synqy-lb-wrapper div.synqy-lb-outer div.synqy-lb-canvas .synqy-lb-toptoolbar .synqy-lb-logo {
  position: absolute;
  width: 130px;
  left: 12px;
  height: 40px;
  top: 7px;
  background: url(//d3uuhfww7vfibx.cloudfront.net/style/shoprite/shoprite-logo.png) no-repeat;
  background-size: contain;
}

div.synqy-lb-wrapper.synqy-device-desktop div.synqy-lb-outer div.synqy-lb-canvas #synqy-lb-btn-canvas-close {
  position: absolute;
  width: 65px;
  height: 50px;
  background-color: transparent !important;
  background: url('//d3uuhfww7vfibx.cloudfront.net/style/shoprite/close_gray.png') no-repeat;
  background-position: center top;
  top: 12px;
  right: 12px;
  z-index: 1;
  cursor: pointer;
}

.synqy-lb-content-outer {
  width: 100%;
  height: 100%;
}

div.synqy-lb-wrapper div.synqy-lb-outer div.synqy-lb-canvas div.synqy-lb-share-outer.active {
  display: none;
}

div.synqy-lb-wrapper div.synqy-lb-outer div.synqy-lb-canvas .synqy-lb-toptoolbar .synqy-lb-toolbar-btns #synqy-lb-btn-close {
  display:none;
}

div.synqy-lb-wrapper.synqy-device-desktop div.synqy-lb-outer div.synqy-lb-bottomtoolbar .synqy-lb-poweredby {
  top: 16px;
}

.synqy-lb-btn-share, .synqy-lb-share-toolbar {
  display: none !important;
}

/* TLI CONTAINER */
.synqy-tli-container {
  position: absolute;
  width: 54px;
  height: 54px;
  top: 30%;
  right: 12%;
  overflow: hidden; 
  z-index: 1000;
  display: inline-block !important;
}

.synqy-tli-container div.synqy-tli-loaded a.activate.synqy-tli-action .synqy-ag-aga1 {
  background-image: none !important;
  background-color: transparent;
}

.synqy-tli-loaded {
  width: 100%;
  height: 100%;
}

.synqy-tli-container div.synqy-tli-loaded a.synqy-tli-action {
  height: 200%;
}

div.synqy-popup-link {
  display: none;
}

/* CONVERSION BTN */
#synqy-lb-btn-conv {
  position: absolute;
  top: 6px; 
  right: 18%;
  width: 20%;
  height: 100%; 
  max-width: 120px; 
  max-height: 32px; 
  background-image: url(//www.thinksynqy.com/shoprite/ecommerce/shoprite-lb-conv-sprite_white.png);
  background-repeat: no-repeat; 
  background-position: top center;
  background-size: auto; 
  border-radius: 2px;
}

#synqy-lb-btn-conv:hover {
  background-position: center center;
}

#synqy-lb-btn-conv.disabled, #synqy-lb-btn-conv.disabled:hover {
  background-position: bottom center;
}


/* ------------ HANDHELD ---------------*/
div.synqy-lb-wrapper.synqy-device-handheld div.synqy-lb-outer div.synqy-lb-canvas
 {
  background-color: #ffffff;
  background-image: url(//d3uuhfww7vfibx.cloudfront.net/style/shoprite/bar-red.png);
  background-repeat: repeat-x;
  background-position: 0 -25px;
}

div.synqy-lb-wrapper.synqy-device-handheld div.synqy-lb-outer div.synqy-lb-canvas .synqy-lb-toptoolbar {
  background: none;
}

div.synqy-lb-wrapper.synqy-device-handheld div.synqy-lb-outer div.synqy-lb-canvas .synqy-lb-toptoolbar .synqy-lb-logo {
  width: 100px;
  left: 6px;
  height: 98%;
  top: 4px;
}

div.synqy-lb-wrapper.synqy-device-handheld div.synqy-lb-outer div.synqy-lb-canvas #synqy-lb-btn-canvas-close {
  position: absolute;
  display: inline-block;
  width: 24px;
  height: 24px;
  background-color: transparent !important;
  background: url('//d3uuhfww7vfibx.cloudfront.net/style/shoprite/close_gray.png') no-repeat;
  background-position: right top;
  top: 6px;
  right: 8px;
  z-index: 1;
}

div.synqy-lb-wrapper.synqy-device-handheld div.synqy-lb-outer div.synqy-lb-canvas .synqy-lb-toptoolbar #synqy-lb-btn-conv {
  position: absolute;
  top: 6px; 
  right: 30%;
  width: 100px;
  height: 24px; 
  max-height: unset;
  max-width: unset;
  margin:0;
  float:unset;
  background-image: url(//www.thinksynqy.com/shoprite/ecommerce/shoprite-lb-conv-sprite_white.png);
  background-repeat: no-repeat; 
  background-position: top center;
  background-size: cover; 
  border-radius: 3px;
}





